Dohrniphora dispar

is recognized by the orange, enlarged flagellomere 1 (
Figures 21, 22
) and the unusually broad and darkened fore tarsomere 5 (
Figure 19
). The distinct dark, circular carina on the posterior face of the hind femur, posterior to a group of approximately 60 ventrobasal peg-like setae also help distinguish it from other species (
Figures 3, 4
).
